  return (
      <Card style={{ width: '18rem' }}>
          <Card.Img variant="top" src={img} height="200" wi/>
          <Card.Body>
              <Card.Title>{ad}</Card.Title>
              <Card.Text>
                  {kurs}
              </Card.Text>
              <h3>{yas}</h3>
          </Card.Body>
      </Card>
  )
}

export default Cards
